import './App.css';
import Items from './component/item/items/items'
import Sizes from './component/sizes/sizes'

function App() {
  return (
    <main className="App">
      <div className='Sizes'>
        Sizes

      </div>
      <main className='itemList'>
          <Items/>
      </main>
    </main>
  );
}

export default App;
